    {
      "cell_type": "markdown",
      "source": [
        "#### **Correlação**"
      ],
      "metadata": {
        "id": "e7N4mT9MwGoz"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "Outra forma interessante deverificar essa diferença é através de um gráfico de dispersão e métricas de correlação.\n",
        "Nesse caso, **não** categorizamos o preço. Vamos plotar em um gráfico o preço de cada imóvel e sua respectiva métrica numérica (ex: preço x qualidade)\n",
        "\n",
        "Material: https://operdata.com.br/blog/coeficientes-de-correlacao/\n",
        "\n",
        "![image.png](data:image/png;base64,)"
      ],
      "metadata": {
        "id": "dTQ8WkQEvK15"
      }
    },
