    {
      "cell_type": "markdown",
      "source": [
        "Tanto ano quanto as features de qualidade/quantidade de banheiro, apesar de serem numéricas, pode ser útil entende-las de outra forma. Isso geralmente acontece quando o número é inteiro (não float) e assume uma quantidade limitada e conhecida de \"categorias\". Chamamos isso de variáveis discretas x contínuas\n",
        "\n",
        "**Variáveis discretas:** características mensuráveis que podem assumir apenas um número finito ou infinito contável de valores e, assim, somente fazem sentido valores inteiros. Geralmente são o resultado de contagens. Exemplos: número de filhos, número de bactérias por litro de leite, número de cigarros fumados por dia.\n",
        "\n",
        "**Variáveis contínuas:** características mensuráveis que assumem valores em uma escala contínua (na reta real), para as quais valores fracionais fazem sentido. Usualmente devem ser medidas através de algum instrumento. Exemplos: peso (balança), altura (régua), tempo (relógio), pressão arterial, idade.\n",
        "\n",
        "**Voltando ao nosso exemplo:**\n",
        "Uma ideia que pode ser interessante para avaliar variáveis discretas é entender a distribuição de preço em cada um dos valores. Por exemplo, distribuição de preço para qualidade 1, distribuição de preço para qualidade 2, etc. Ou seja, o **X do nosso boxplot será a feature e o Y do boxplot será o preço**"
      ],
      "metadata": {
        "id": "6gwv3IFfy1qi"
      }
    },
